import React, { useState } from "react";
import { Link } from "react-router-dom";
import styles from "../modules/Header.module.css";

export default function Header() {
  const [isNavbarActive, setIsNavbarActive] = useState(false);
  const [onScroll, setOnScroll] = useState(false);

  const onNavbarScroll = () => {
    console.log(window.scrollY);
    if (window.scrollY >= 10) {
      setOnScroll(true);
    } else {
      setOnScroll(false);
    }
  };

  const onHamburgerClick = () => {
    setIsNavbarActive(!isNavbarActive);
  };

  window.addEventListener("scroll", onNavbarScroll);

  return (
    <header
      className={
        onScroll
          ? styles.navbarContainer + " " + styles.navbarScroll
          : styles.navbarContainer
      }
    >
      <Link to="/">
        <div className={styles.navbarLogo}>DOMAIN SELLER</div>
      </Link>
      <nav
        className={
          isNavbarActive
            ? styles.navbarWrapper + " " + styles.navbarActive
            : styles.navbarWrapper
        }
      >
        <ul className={styles.navbar}>
          <Link to="/tld" onClick={onHamburgerClick}>
            <li className={styles.navbarItem}>
              <h4 className={styles.navbarText} href="#">
                TLD
              </h4>
            </li>
          </Link>
          <Link to="sld" onClick={onHamburgerClick}>
            <li className={styles.navbarItem}>
              <h4 className={styles.navbarText} href="#">
                SLD
              </h4>
            </li>
          </Link>
          <Link to="aboutUs" onClick={onHamburgerClick}>
            <li className={styles.navbarItem}>
              <h4 className={styles.navbarText} href="#">
                About Us
              </h4>
            </li>
          </Link>
          <Link to="contactUs" onClick={onHamburgerClick}>
            <li className={styles.navbarItem}>
              <h4 className={styles.navbarText} href="#">
                Contact Us
              </h4>
            </li>
          </Link>
        </ul>
      </nav>
      <div
        className={
          isNavbarActive
            ? styles.hamburger + " " + styles.toggle
            : styles.hamburger
        }
        onClick={onHamburgerClick}
      >
        <div className={styles.arrow1}></div>
        <div className={styles.arrow2}></div>
        <div className={styles.arrow3}></div>
      </div>
    </header>
  );
}
